class MonitoredTableRuleInput(sgqlc.types.Input):
    __schema__ = schema
    __field_names__ = (
        "is_exclude",
        "rule_type",
        "table_rule_text",
        "table_rule_attribute",
        "id",
        "monitored_rule_type",
    )
